<span class="line"><span style="color:#A6ACCD;">另外，sync</span><span style="color:#89DDFF;">.</span><span style="color:#A6ACCD;">Map 是线程安全的 </span><span style="color:#89DDFF;">map</span><span style="color:#A6ACCD;">，也可以使用。</span></span>
